About seven women during World War II who volunteer to join the ATS (Auxiliary Territorial Service). From many varied backgrounds, the women quickly form a bond and become friends. They are then posted to various jobs, some of them in the same place, some of them separated. They are drilling, driving lorries, and manning ack-ack batteries. As they encounter each other, tensions begin to show and the group becomes divided. Shortly after release, narrator and co-director Leslie Howard was killed when the Luftwaffe shot down his plane whilst on a secret mission to Portugal.


